"use strict";(self.webpackChunkstorybook_app=self.webpackChunkstorybook_app||[]).push([[54290],{"../../packages/ui/src/features/web-lite/README.md":module=>{module.exports="# Web-Lite UI Components\n\nThis directory contains Tamagui-based UI components for the web-lite application.\n\n## Structure\n\n- `components/` - Shared UI components used across pages\n- `pages/` - Page layouts for the application\n  - `home/` - Home page components\n  - `room/` - Room page components\n  - `swap/` - Swap interface components\n  - `settings/` - Settings page components\n  - `trade/` - Trading interface components\n  - `wallet/` - Wallet management components\n- `navigation/` - Navigation components and configuration\n- `theme/` - Theme overrides and customizations\n\n## Guidelines\n\n- Each page should be self-contained in its own directory\n- Reuse components from the shared `components` directory when possible\n- Follow Tamagui's styling patterns and components\n- Keep business logic separate from presentation components\n"}}]);